Tempe‚Äôs first craft distillery has been operating for over 5 years at its current location. We began 2020 with much excitement and were in the process to bring you our long-awaited whiskey! In March we had adjusted operations to produce hand sanitizer to assist and help our communities deal with the COVID-19 pandemic. 

While those adjustments helped us overcome the many challenges facing businesses this year, we didn‚Äôt anticipate losing our home prematurely. After overwhelming legal battles to stay, we are now forced to find a new home. Which is no easy process. This is an extremely difficult journey plus a major financial impact to rebuild as well. 

The hardest part of all for us comes with an extremely heavy heart, which is to inform you, our family of wonderful friends, that CaskWerks Distilling Co. final day of operation will be Sept 19th, 2020. 

CaskWerks Tasting Room will be open every Thursday, Friday & Saturday (3pm to 7pm) until the final day. We are so grateful for all of your support and to meet so many amazing people over the years. We will do our best to re-open and will miss you all! 

Chris & John
